import React from "react";
import { Link } from "react-router-dom"


function Home() {
    return(
        <div>
            <h1>Homepage</h1>
            <p>This is the homepage</p>
            <link to="/upload" >Upload</link>
            <link to="/allkhutbah" >All Khutbah</link>
        </div>
    );
}

export default Home;
